import { Search, ShoppingCartCheckoutOutlined, ShoppingCartOutlined } from '@mui/icons-material';
import { Badge } from '@mui/material';
import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
    height:60px;
`;
const Wrapper = styled.div`
    padding:10px 20px;
    display:flex;
    justify-content:space-between;
    align-items:center;

`;
let Left=styled.div`
flex:1;
display:flex;
align-items:center`;

const Languages=styled.span`
font-siez:14px;
cursor:pointer;
`;
const SearchContainer = styled.div`
border: 0.5px solid lightgrey;
display: flex;
align-items: center;
margin-left: 25px;
padding: 5px;`;
const Input =styled.input`border:none`;
const Logo=styled.h1`
font-weight:bold;
`;
let Right=styled.div`
flex:1;
display:flex;
align-items:center;
justify-content:flex-end;


`;

const MenuItem=styled.div`
font-size:14px;
cursuor:pointer,
margin-left:25px;
`;

let Center=styled.div`
flex:1;
text-align:center;`

;
const Navbar = () => {
  return (
    <Container>
        <Wrapper>
             <Left>
             <Languages>EN</Languages>  
                <SearchContainer>

                    <Input/> 
                    <Search/>
                </SearchContainer>
                </Left>

            <Center>
                <Logo>LAMA.</Logo>
            </Center>
            <Right>
            <MenuItem>REGISTER</MenuItem>
            <MenuItem>SIGN IN </MenuItem>
            <MenuItem>
            <Badge badgeContent={4} color="primary">
             <ShoppingCartOutlined/>
            </Badge>
            </MenuItem>
            </Right>
       </Wrapper>
    </Container>
  )
}



export default Navbar
